#include <iostream>
#include <vector>
#include <string>

using namespace std;

bool partexist(vector<vector<char> > & board, string word, int i, int j, vector<vector<bool> > &  visited, int pos) {
    if(board[i][j] != word[pos])
        return false;
    if(word.length() - 1 == pos)
        return true;
    visited[i][j] = true;
    if(i > 0 && !visited[i - 1][j] && partexist(board, word, i - 1, j, visited, pos + 1)) {
        return true;
    }
    if(i < board.size() - 1 && !visited[i + 1][j] && partexist(board, word, i + 1, j, visited, pos + 1)) {
        return true;
    }
    if(j > 0 && !visited[i][j - 1] && partexist(board, word, i, j - 1, visited, pos + 1)) {
        return true;
    }
    if(j < board[i].size() - 1 && !visited[i][j + 1] && partexist(board, word, i, j + 1, visited, pos + 1)) {
        return true;
    }
    visited[i][j] = false;
    return false;
}

bool exist(vector<vector<char> >& board, string word) {
    if(word.empty())
        return false;
    vector<vector<bool> > visited;
    for (int i1 = 0; i1 < board.size(); ++i1)
    {
        vector<bool> visitedcell(board[i1].size(), false);
        visited.push_back(visitedcell);
    }
    for (int i = 0; i < board.size(); ++i)
    {
        for (int j = 0; j < board[i].size(); ++j)
        {
            if(partexist(board, word, i, j, visited, 0))
                return true;
        }
    }
    return false;
}

